import React, {useContext, useEffect, useState} from "react";
import {
	Row,
	Col,
	CardBody,
	CardTitle,
	CardImg,
	Button,
	CardText,
} from "reactstrap";
import UpdateUser from "./UpdateUser";
//Import Images
import img2 from "../../assets/images/small/img-2.jpg";

const GetUsers = ({face, eliminarUsuario}) => {
	const [actualizar, setModal] = useState(false);

	const toggleActualizar = () => setModal(!actualizar);
	return (
		<Row className="no-gutters align-items-center">
			<Col md={3}>
				<CardImg className="img-fluid" src={img2} alt="Skote" />
			</Col>
			<Col md={9}>
				<CardBody>
					<CardTitle>
						<h5>
							{face.name} {face.surname}
						</h5>
					</CardTitle>
					<CardText>
						<strong>Edad:</strong> {face.age} - <strong>Sexo:</strong>{" "}
						{face.gender}
					</CardText>
					<CardText>
						<Button color="primary" className=" waves-effect waves-light mr-2">
							Editar
						</Button>
						<Button
							color="secondary"
							outline
							className=" waves-effect waves-light"
							onClick={() => eliminarUsuario(face._id)}>
							Eliminar
						</Button>
					</CardText>
				</CardBody>
			</Col>
			<Modal
				isOpen={actualizar}
				centered={true}
				toggleActualizar={toggleActualizar}
				className={className}>
				<UpdateUser toggle={toggle}></UpdateUser>
			</Modal>
		</Row>
	);
};

export default GetUsers;
